import image from './image.JPG';

function Card(props) {
    return (
      <div className="card">
        <h3>글제목: {  props.title.title } </h3>
        <img src={ image } width='300' height='300' />
        <p>발행일: { props.title.time } </p>
        <div>좋아요 ♡</div>
        <hr />
      </div>
    )
  }


export default Card
